from pwn import *
#
def getsign(s):
    try:
        r = process("container/service")
        r.recvuntil("Command:")
        r.sendline("86 86 " + str(s) + " ")
        r.recvuntil("//")
        resp = r.recvline()[0]
        r.close()
        return resp
    except:
        return "undef"
mapping = [(0,0)]*10000

for j in range(10000):
    sign = getsign(j)
    mapping[j] = (j, sign)
#print(mapping)
print([str(x[1]) for x in mapping])
